<!DOCTYPE html>
<html lang="en">
<head>
  <meta charset="UTF-8">
  <meta name="viewport" content="width=device-width, initial-scale=1.0">
  <title>Room Checker - MANGO</title>
  <link rel="stylesheet" href="style.css">
  <style>
    body {
      min-height: 100vh;
      padding: 20px 20px 60px;
      background-color: #848FAF;
    }

    h1 {
      margin: 30px 0 10px;
      font-size: 2.5em;
    }

    .subtitle {
      text-align: center;
      color: #1E3A5F;
      font-family: 'coolfont';
      font-size: 1em;
      margin-bottom: 40px;
      letter-spacing: 2px;
    }

    /* ── Search box ── */
    .search-wrapper {
      max-width: 520px;
      margin: 0 auto 48px;
      display: flex;
      flex-direction: column;
      gap: 14px;
      align-items: center;
    }

    .search-box {
      width: 100%;
      display: flex;
      gap: 10px;
    }

    #rollInput {
      flex: 1;
      padding: 16px 20px;
      font-size: 1.1em;
      font-family: 'coolfont';
      border: 2px solid #AFC3B4;
      border-radius: 12px;
      background: #99ADA1;
      color: #555;
      outline: none;
      text-transform: uppercase;
      letter-spacing: 1px;
      transition: box-shadow 0.3s;
    }

    #rollInput::placeholder {
      color: #555;
      text-transform: none;
    }

    #rollInput:focus {
      box-shadow: 0 0 20px rgba(175,195,180,0.5);
    }

    #searchBtn {
      padding: 16px 26px;
      font-family: 'coolfont';
      font-size: 1em;
      background: #536391;
      color: #1E3A5F;
      border: none;
      border-radius: 12px;
      cursor: pointer;
      transition: all 0.25s;
      white-space: nowrap;
    }

    #searchBtn:hover {
      background: #AFC3B4;
      transform: scale(1.04);
      box-shadow: 0 0 20px rgba(175,195,180,0.6);
    }

    .hint {
      font-family: 'coolfont';
      font-size: 0.8em;
      color: #7BAAA1;
      letter-spacing: 1px;
    }

    /* ── Results ── */
    #results {
      max-width: 700px;
      margin: 0 auto;
    }

    .result-header {
      text-align: center;
      margin-bottom: 28px;
    }

    .result-roll {
      font-family: 'coolfont';
      font-size: 1.5em;
      color: #1E3A5F;
      letter-spacing: 3px;
    }

    .result-count {
      font-family: 'coolfont';
      color: #1E3A5F;
      font-size: 0.85em;
      margin-top: 6px;
    }

    /* Exam card */
    .exam-card {
      background: #111;
      border-radius: 16px;
      overflow: hidden;
      margin-bottom: 20px;
      box-shadow: 0 10px 30px rgba(0,0,0,0.6);
      position: relative;
      animation: slideUp 0.4s ease both;
    }

    .exam-card::before {
      content: "";
      position: absolute;
      inset: 0;
      background-image: url(images/penguin.avif);
      background-size: cover;
      background-position: bottom;
      background-repeat: no-repeat;
      z-index: 0;
    }

    @keyframes slideUp {
      from { opacity: 0; transform: translateY(18px); }
      to   { opacity: 1; transform: translateY(0); }
    }

    .exam-card-header {
      display: flex;
      justify-content: space-between;
      align-items: center;
      padding: 18px 22px;
      border-bottom: 1px solid #222;
      position: relative;
      z-index: 1;
    }

    .exam-date {
      font-family: 'coolfont';
      font-size: 1.1em;
      color: #1E3A5F;
      font-weight: bold;
    }

    .session-tag {
      font-family: 'coolfont';
      font-size: 0.8em;
      padding: 6px 14px;
      border-radius: 8px;
      font-weight: 800;
    }

    .session-tag.morning {
      background: #FFD700;
      color: #1E3A5F;
    }

    .session-tag.evening {
      background: #AFC3B4;
      color: #1E3A5F;
    }

    .exam-body {
      display: grid;
      grid-template-columns: 1fr 1fr;
      gap: 0;
      position: relative;
      z-index: 1;
    }

    .exam-field {
      padding: 16px 22px;
      /* border-right: 1px solid #222; */
      border-bottom: 1px solid #222;
    }

    .exam-field:nth-child(even) {
      border-right: none;
    }

    .exam-field:nth-last-child(-n+2) {
      border-bottom: none;
    }

    .field-label {
      font-family: 'coolfont';
      font-size: 0.7em;
      color: #1E3A5F;
      letter-spacing: 2px;
      margin-bottom: 6px;
    }

    .field-value {
      font-family: 'coolfont';
      font-size: 1.1em;
      color: #FFD700;
      text-shadow: 1px 1px 3px rgba(0,0,0,0.6);
    }

    /* today highlight */
    .exam-card.today-exam {
      border: 2px solid #AFC3B4;
      box-shadow: 0 0 40px rgba(175,195,180,0.6), 0 10px 30px rgba(0,0,0,0.6);
    }

    .today-pill {
      display: inline-block;
      background: #AFC3B4;
      color: #1E3A5F;
      font-family: 'coolfont';
      font-size: 0.75em;
      padding: 4px 12px;
      border-radius: 20px;
      margin-left: 10px;
      animation: pulse 2s infinite;
    }

    @keyframes pulse {
      0%,100% { box-shadow: 0 0 10px rgba(175,195,180,0.6); }
      50%      { box-shadow: 0 0 22px rgba(175,195,180,1); }
    }

    /* Error / empty states */
    .error-box {
      text-align: center;
      padding: 50px 20px;
    }

    .error-emoji {
      font-size: 3em;
      margin-bottom: 16px;
    }

    .error-msg {
      font-family: 'coolfont';
      font-size: 1.2em;
      color: #AFC3B4;
    }

    .error-sub {
      font-family: 'coolfont';
      font-size: 0.85em;
      color: #555;
      margin-top: 8px;
    }

    /* Time info */
    .time-info {
      font-family: 'coolfont';
      font-size: 0.75em;
      color: #555;
      text-align: center;
      margin-top: -36px;
      margin-bottom: 32px;
    }

    /* day-of-week label */
    .dow {
      font-family: 'coolfont';
      font-size: 0.72em;
      color: #7BAAA1;
      margin-left: 8px;
      letter-spacing: 1px;
    }
  </style>
</head>
<body>

  <h1>Room Checker</h1>
  <h2 class="subtitle">MIDSEMS</h2>
  <div class="search-wrapper">
    <div class="search-box">
      <input id="rollInput" type="text" placeholder="Enter your roll number…" autocomplete="off" spellcheck="false">
      <button id="searchBtn">CHECK</button>
    </div>
    <!-- <span class="hint">e.g. 2301CS01 · 2501ME42 · 2411PH05</span> -->
  </div>

  <!-- <p class="time-info" id="timeInfo"></p> -->
  <div id="results"></div>

", "session": "MORNING", "room": "LT102", "course": "CH002"}, {"date": "27-02-2026", "session": "MORNING", "room": "502", "course": "HS002"}, {"date": "28-02-2026", "session": "MORNING", "room": "LT103", "course": "PH002"}], "2522ME08": [{"date": "24-02-2026", "session": "EVENING", "room": "103", "course": "ME6210/ME501"}], "2422ME03": [{"date": "25-02-2026", "session": "EVENING", "room": "102", "course": "ME6202"}], "2422CE08": [{"date": "25-02-2026", "session": "EVENING", "room": "104", "course": "CE5204/CE6240"}, {"date": "27-02-2026", "session": "EVENING", "room": "LT102", "course": "CE5209/CE6221"}], "2422HS03": [{"date": "26-02-2026", "session": "EVENING", "room": "502", "course": "HS7206"}], "2422HS04": [{"date": "26-02-2026", "session": "EVENING", "room": "502", "course": "HS7206"}], "2422HS06": [{"date": "26-02-2026", "session": "EVENING", "room": "502", "course": "HS7206"}], "2422HS13": [{"date": "26-02-2026", "session": "EVENING", "room": "502", "course": "HS7206"}], "2422EE01": [{"date": "26-02-2026", "session": "EVENING", "room": "502", "course": "EE6216"}], "2422CE11": [{"date": "27-02-2026", "session": "EVENING", "room": "LT102", "course": "CE5209/CE6221"}, {"date": "28-02-2026", "session": "EVENING", "room": "LT003", "course": "CE526/CE5210/CE6222"}]};

    const SESSION_TIMES = {
      MORNING: "10:30 AM – 12:30 PM",
      EVENING: "3:30 PM – 5:30 PM"
    };

    const DAY_NAMES = ["Sunday","Monday","Tuesday","Wednesday","Thursday","Friday","Saturday"];

    function parseDMY(str) {
      const [d,m,y] = str.split("-");
      return new Date(+y, +m-1, +d);
    }

    function getTodayStr() {
      const t = new Date();
      const d = String(t.getDate()).padStart(2,"0");
      const m = String(t.getMonth()+1).padStart(2,"0");
      const y = t.getFullYear();
      return `${d}-${m}-${y}`;
    }

    function formatDate(str) {
      const dt = parseDMY(str);
      const dow = DAY_NAMES[dt.getDay()];
      return { pretty: str, dow };
    }

    function doSearch() {
      const raw = document.getElementById("rollInput").value.trim().toUpperCase();
      const results = document.getElementById("results");
      results.innerHTML = "";

      if (!raw) return;

      const exams = EXAM_DATA[raw] || EXAM_DATA[raw.toLowerCase()];

      if (!exams || exams.length === 0) {
        results.innerHTML = `
          <div class="error-box">
            <div class="error-emoji">🔍</div>
            <div class="error-msg">Roll number not found</div>
            <div class="error-sub">Check spelling — e.g. 2301CS01</div>
          </div>`;
        return;
      }

      const todayStr = getTodayStr();

      // Sort by date then session
      const sorted = [...exams].sort((a,b) => {
        const da = parseDMY(a.date), db = parseDMY(b.date);
        if (da - db !== 0) return da - db;
        return a.session.localeCompare(b.session);
      });

      // Header
      const headerDiv = document.createElement("div");
      headerDiv.className = "result-header";
      headerDiv.innerHTML = `
        <div class="result-roll">${raw}</div>
        <div class="result-count">${sorted.length} EXAM${sorted.length > 1 ? "S" : ""} SCHEDULED</div>
      `;
      results.appendChild(headerDiv);

      sorted.forEach((exam, i) => {
        const isToday = exam.date === todayStr;
        const { pretty, dow } = formatDate(exam.date);
        const sessionLC = exam.session.toLowerCase();
        const timeStr = SESSION_TIMES[exam.session] || exam.session;

        const card = document.createElement("div");
        card.className = "exam-card" + (isToday ? " today-exam" : "");
        card.style.animationDelay = (i * 0.08) + "s";

        card.innerHTML = `
          <div class="exam-card-header">
            <div class="exam-date">
              ${pretty}
              ${isToday ? '<span class="today-pill">TODAY</span>' : ""}
            </div>
            <span class="session-tag ${sessionLC}">${exam.session}</span>
          </div>
          <div class="exam-body">
            <div class="exam-field">
              <div class="field-label">COURSE</div>
              <div class="field-value">${exam.course}</div>
            </div>
            <div class="exam-field">
              <div class="field-label">ROOM</div>
              <div class="field-value">${exam.room}</div>
            </div>
            <div class="exam-field" style="grid-column: 1 / -1;">
              <div class="field-label">TIME</div>
              <div class="field-value">${timeStr}</div>
            </div>
          </div>
        `;

        results.appendChild(card);
      });
    }

    // Button click
    document.getElementById("searchBtn").addEventListener("click", doSearch);

    // Enter key
    document.getElementById("rollInput").addEventListener("keydown", e => {
      if (e.key === "Enter") doSearch();
    });

    // Show today's date
    const today = new Date();
    document.getElementById("timeInfo").textContent =
      "Today: " + DAY_NAMES[today.getDay()] + ", " + today.toLocaleDateString("en-IN", {day:"numeric",month:"long",year:"numeric"});
  </script>
